			runOnlyForDeploymentPostprocessing = 0;
			shellPath = /bin/sh;
			shellScript = "## This is the Waypoint-Info.plist file which is managed in GIT.  I choose not to use or modify it to avoid the add'l push needed after a build.\n## If you wish to refresh the 3 values modified below in the Waypoint-Info.plist, uncomment the next line and comment out the TARGET line for the Info.plist (temporarily).\n## TARGET=\"$PROJECT_DIR/Waypoint/Waypoint-Info.plist\"\n\n##  This is the Info.plist, which is created at build time from the Waypoint-Info.plist file. It is not managed in GIT\nTARGET=\"${BUILT_PRODUCTS_DIR}/${INFOPLIST_PATH}\"\nDSYM_SRC=\"${BUILT_PRODUCTS_DIR}/${ARCHIVE_DSYMS_PATH}${DWARF_DSYM_FILE_NAME}\"\nDSYM_INFO=\"$DSYM_SRC/Contents/Info.plist\"\necho \"Target build dir: \"${TARGET_BUILD_DIR}\necho \"Info.plist path: \"${INFOPLIST_PATH}\necho \"dSYM path: \"$DSYM_SRC\necho \"Target is \" $TARGET\n\nif [ ! -f \"$TARGET\" ]; then\necho \"missing file $TARGET\"\nexit 1;\nfi\n\nif [ ! -f \"$DSYM_INFO\" ]; then\necho \"missing file $DSYM_INFO\"\nexit 1;\nfi\n\nBUILDSHA=`git rev-parse --short HEAD`\necho \"BUILDSHA is\" $BUILDSHA\n\n## Set a newly defined value in the Info.plist for the SHA\n/usr/libexec/PListBuddy -c \"Set BuildSHA $BUILDSHA\" \"$TARGET\"\n/usr/libexec/PListBuddy -c \"Set BuildSHA $BUILDSHA\" \"$DSYM_INFO\"\n\n\n## The build number is a count of the commit objects for the project HEAD\nBUILDNUMBER=$(git rev-list HEAD | wc -l | tr -d ' ')\necho \"BUILDNUMBER is \" $BUILDNUMBER\n\n/usr/libexec/PlistBuddy -c \"Set :CFBundleVersion $BUILDNUMBER\" \"$TARGET\"\n/usr/libexec/PlistBuddy -c \"Set :CFBundleVersion $BUILDNUMBER\" \"$DSYM_INFO\"\n\n## All of following gibberish was replaced by \"git rev-parse --short HEAD\" above\n##BRANCH=`git status | head -1 | cut -c 13-100`\n##NEW_VERSION=`git log refs/heads/$BRANCH | head -1 | cut -c 8-13`\n##echo \"$NEW_VERSION\"\n##/usr/libexec/PListBuddy -c \"Set CFBundleVersion $NEW_VERSION\" \"$TARGET\"\n\nCFBuildDate=$(date \"+%Y-%m-%d% %H:%M %Z\")\n/usr/libexec/PListBuddy -c \"Set :CFBuildDate $CFBuildDate\" \"$TARGET\"";
		};
